import React, { useState, useEffect } from 'react';
import API from '../../api/api';
import './AdminPanel.css';

export default function AdminPanel() {
  const [form, setForm] = useState({});
  const [file, setFile] = useState(null);
  const [products, setProducts] = useState([]);
  const [editingId, setEditingId] = useState(null); // for update

  useEffect(() => {
    load();
  }, []);

  function load() {
    API.get('/products')
      .then(r => setProducts(r.data.products || r.data))
      .catch(console.error);
  }

  async function submit(e) {
    e.preventDefault();
    const fd = new FormData();
    fd.append('name', form.name || '');
    fd.append('description', form.description || '');
    fd.append('price', form.price || 0);
    fd.append('colors', form.colors || '');
    fd.append('countInStock', form.countInStock || 0);
    if (file) fd.append('image', file);

    try {
      if (editingId) {
        await API.put('/admin/product/' + editingId, fd, {
          headers: { 'Content-Type': 'multipart/form-data' },
        });
        setEditingId(null);
      } else {
        await API.post('/admin/product', fd, {
          headers: { 'Content-Type': 'multipart/form-data' },
        });
      }
      alert('Saved');
      setForm({});
      setFile(null);
      load();
    } catch (err) {
      alert(err.response?.data?.message || err.message);
    }
  }

  async function remove(id) {
    if (!window.confirm('Are you sure you want to delete this product?')) return;
    try {
      await API.delete('/admin/product/' + id);
      load();
    } catch (e) {
      alert(e.message);
    }
  }

  function editProduct(p) {
    setForm({
      name: p.name,
      description: p.description,
      price: p.price,
      colors: p.colors,
      countInStock: p.countInStock,
    });
    setEditingId(p._id);
  }

  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">Admin Panel - Products</h2>

      {/* Form */}
      <form
        onSubmit={submit}
        className="bg-white p-6 rounded-lg shadow-md mb-8 grid grid-cols-1 md:grid-cols-2 gap-4"
      >
        <input
          placeholder="Name"
          onChange={e => setForm({ ...form, name: e.target.value })}
          value={form.name || ''}
          className="border p-2 rounded"
        />
        <input
          placeholder="Price"
          onChange={e => setForm({ ...form, price: e.target.value })}
          value={form.price || ''}
          className="border p-2 rounded"
        />
        <input
          placeholder="Colors (comma)"
          onChange={e => setForm({ ...form, colors: e.target.value })}
          value={form.colors || ''}
          className="border p-2 rounded"
        />
        <input
          placeholder="Stock"
          onChange={e => setForm({ ...form, countInStock: e.target.value })}
          value={form.countInStock || ''}
          className="border p-2 rounded"
        />
        <input
          type="file"
          onChange={e => setFile(e.target.files[0])}
          className="border p-2 rounded col-span-1 md:col-span-2"
        />
        <button
          type="submit"
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700 transition-colors col-span-1 md:col-span-2"
        >
          {editingId ? 'Update Product' : 'Add Product'}
        </button>
      </form>

      {/* Products List */}
      <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {products.map(p => (
          <div key={p._id} className="bg-white rounded-lg shadow p-4 flex flex-col items-center">
            <img
              src={p.image || 'https://via.placeholder.com/150'}
              alt={p.name}
              className="w-32 h-32 object-cover rounded mb-4"
            />
            <div className="text-lg font-semibold">{p.name}</div>
            <div className="text-gray-600 mb-2">${p.price}</div>
            <div className="flex gap-2 mt-auto">
              <button
                onClick={() => editProduct(p)}
                className="bg-yellow-500 text-white px-3 py-1 rounded hover:bg-yellow-600 transition-colors"
              >
                Update
              </button>
              <button
                onClick={() => remove(p._id)}
                className="bg-red-500 text-white px-3 py-1 rounded hover:bg-red-600 transition-colors"
              >
                Delete
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
